import React, { useEffect } from 'react';
import axios from 'axios'
function Book() {
    useEffect(() => {
        axios.get('/data_load')
        .then((response) => response.json())
        .catch(function (error) {
          console.log(error);
        });
      }, []);
    return(
        <div className="App">
          
        </div>
    );
}
export default Book;
